import React from "react";
import "./PhotoGrid.css"; // Ensure this file exists

const photos = [
  {
    id: 1,
    src: "https://images.pexels.com/photos/1640774/pexels-photo-1640774.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940",
    alt: "Butter Chicken",
  },
  {
    id: 2,
    src: "https://images.pexels.com/photos/1170890/pexels-photo-1170890.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940",
    alt: "Palak Paneer",
  },
  {
    id: 3,
    src: "https://images.pexels.com/photos/1640773/pexels-photo-1640773.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940",
    alt: "Aloo Gobi",
  },
  {
    id: 4,
    src: "https://images.pexels.com/photos/3406792/pexels-photo-3406792.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940",
    alt: "Chole Bhature",
  },
  {
    id: 5,
    src: "https://images.pexels.com/photos/2648686/pexels-photo-2648686.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940",
    alt: "Paneer Tikka",
  },
  {
    id: 6,
    src: "https://images.pexels.com/photos/1640772/pexels-photo-1640772.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940",
    alt: "Biryani",
  },
  {
    id: 7,
    src: "https://images.pexels.com/photos/1591572/pexels-photo-1591572.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940",
    alt: "Dhokla",
  },
  {
    id: 8,
    src: "https://images.pexels.com/photos/1640775/pexels-photo-1640775.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940",
    alt: "Samosa",
  },
  {
    id: 9,
    src: "https://images.pexels.com/photos/3660151/pexels-photo-3660151.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940",
    alt: "Dal Makhani",
  },
  {
    id: 10,
    src: "https://images.pexels.com/photos/2501924/pexels-photo-2501924.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940",
    alt: "Tandoori Chicken",
  },
  {
    id: 11,
    src: "https://images.pexels.com/photos/2797764/pexels-photo-2797764.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940",
    alt: "Gulab Jamun",
  },
  {
    id: 12,
    src: "https://images.pexels.com/photos/1586239/pexels-photo-1586239.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940",
    alt: "Kheer",
  },
  {
    id: 13,
    src: "https://images.pexels.com/photos/1050238/pexels-photo-1050238.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940",
    alt: "Lassi",
  },
  {
    id: 14,
    src: "https://images.pexels.com/photos/4581863/pexels-photo-4581863.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940",
    alt: "Chaat",
  },
  {
    id: 15,
    src: "https://images.pexels.com/photos/4200720/pexels-photo-4200720.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940",
    alt: "Pav Bhaji",
  },
  {
    id: 16,
    src: "https://images.pexels.com/photos/4200723/pexels-photo-4200723.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940",
    alt: "Baingan Bharta",
  },
];

const SectionTwo = () => {
  return (
    <div className="relative overflow-hidden my-10 px-4">
      <h2 className="text-3xl font-bold text-center mb-10">
        Explore Our Culinary Delights
      </h2>
      <div className="flex animate-slide min-h-[250px] justify-center py-4">
        {photos.map((photo) => (
          <div
            key={photo.id}
            className="photo-card transform transition-transform duration-500 hover:scale-105 mx-4"
          >
            <img
              src={photo.src}
              alt={photo.alt}
              className="w-48 h-48 object-cover rounded-lg mb-3"
            />
            <div className="p-3">
              <h3 className="text-lg font-semibold">{photo.alt}</h3>
            </div>
          </div>
        ))}
        {/* Duplicate for infinite scroll effect */}
        {photos.map((photo) => (
          <div
            key={photo.id + 100} // Unique key
            className="photo-card transform transition-transform duration-500 hover:scale-105 mx-4"
          >
            <img
              src={photo.src}
              alt={photo.alt}
              className="w-48 h-48 object-cover rounded-lg mb-3"
            />
            <div className="p-3">
              <h3 className="text-lg font-semibold">{photo.alt}</h3>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default SectionTwo;
